pragma solidity 0.7.5;

contract Ownable{

    //State variable(s)
    address internal owner; 

    //Modifier(s) is/are for restricting permissions like "only employees", "admins", or "owner" etc...
    modifier onlyOwner {
        require(msg.sender == owner);  
        _;
    }

    // Constructor to initialize var
    constructor(){
        owner = msg.sender; 
    }
}
